        } // if ($deep)

        if ($this->collOrdenDevolucions instanceof PropelCollection) {
            $this->collOrdenDevolucions->clearIterator();
        }
        $this->collOrdenDevolucions = null;
        if ($this->collSolicitudDevDetalles instanceof PropelCollection) {
